import React from 'react'; 
// import Greating from './Greating';
import * as ques from './Cal';
 
function App(){

return <> 
 
<ul>
<span>Simple Calculator...</span>

<li>Addtion is this : { ques.sum(2,2)}</li>
<li>Substraction is this:  { ques.sub(4,2)}</li>
<li>division is this :{ ques.dev(4,2)}</li>
<li>multiplication is this : { ques.mul(8,128)}</li>
</ul>

</>;
 


}
export default App;
